import React, { Component }  from 'react';
import {Link} from 'react-router-dom';
function Nav() {
    return (<div>
        <h1>Hello</h1>


        <div>
        <button onClick={(e) => { navigate('/login') }} >Login</button>
        </div>



        <Link to="/login">Login</Link>
        <br/>
        <Link to="/register">Register</Link>
         </div>
         )


}
export default Nav
